At 6pm last night, a bug made Hubs start deleting all data.

@sanjay and @sds made a surgical fix to one hub, which let it feed all the data back into the network. 

You can see the distributed system healing itself as hubs lose and then regain all their messages and get back in sync.

@hodges.eth, on the topic of spam our goal is to do a two prong approach: 

- Protocol fee for storage, which adds significant friction (but does not compromise censorship resistance).

- Client level algos, which by definition will have to evolve as the patterns of spammers keep shifting.

